script: |
  super -f text -I q11618.spq | sort > q11618.out

inputs:
  - name: q11618.spq
    data: |
      SELECT DISTINCT - 55 + - + col0 / + 71 FROM tab1 (FORMAT parquet) AS cor0 WHERE + col1 NOT BETWEEN col0 AND - 61;
  - name: tab1

outputs:
  - name: q11618.out
    data: |
      -55
      -56
